// eraNameMap maps block types to era names for improved error messages.
// When adding a new era/block type, this map must be updated in lockstep.
var eraNameMap = map[uint]string{
	BlockTypeShelley: shelley.EraNameShelley,
	BlockTypeAllegra: allegra.EraNameAllegra,
	BlockTypeMary:    mary.EraNameMary,
	BlockTypeAlonzo:  alonzo.EraNameAlonzo,
	BlockTypeBabbage: babbage.EraNameBabbage,
	BlockTypeConway:  conway.EraNameConway,
}

// testSkipAllValidationConfig returns a VerifyConfig that skips body hash, stake pool, and transaction validation.
// Useful for tests that don't provide full CBOR or ledger state.
func testSkipAllValidationConfig() common.VerifyConfig {
	return common.VerifyConfig{
		SkipBodyHashValidation:    true,
		SkipTransactionValidation: true,
		SkipStakePoolValidation:   true,
	}
}

// decodeTxBodyBytes extracts transaction body bytes from either []byte or hex string
func decodeTxBodyBytes(t *testing.T, v any) []byte {
	t.Helper()
	switch b := v.(type) {
	case []byte:
		return b
	case string:
		txBodyBytes, err := hex.DecodeString(b)
		if err != nil {
			t.Fatalf("failed to hex decode transaction body string: %v", err)
		}
		return txBodyBytes
	default:
		t.Fatalf("unexpected type for tx body: %T", v)
		return nil
	}
}

// decodeTxBodies decodes transaction bodies for a specific era
func decodeTxBodies[T any](t *testing.T, txs []any, label string) []T {
	t.Helper()
	bodies := make([]T, len(txs))
	for i, tx := range txs {
		txArray, ok := tx.([]any)
		if !ok {
			t.Fatalf("unexpected %s tx element type %T", label, tx)
		}
		txBodyBytes := decodeTxBodyBytes(t, txArray[0])
		if _, err := cbor.Decode(txBodyBytes, &bodies[i]); err != nil {
			t.Fatalf(
				"failed to decode %s transaction body %d: %v",
				label,
				i,
				err,
			)
		}
	}
	return bodies
}

// decodeTransactionMetadataSet decodes transaction metadata set for a specific era
func decodeTransactionMetadataSet(
	t *testing.T,
	txs []any,
	eraName string,
) common.TransactionMetadataSet {
	t.Helper()
	transactionMetadataSet := make(map[uint]cbor.RawMessage)
	for i, tx := range txs {
		txArray, ok := tx.([]any)
		if !ok {
			t.Fatalf(
				"unexpected %s tx element type %T while decoding metadata",
				eraName,
				tx,
			)
		}
		if len(txArray) > 2 {
			if lv, ok := txArray[2].(*cbor.LazyValue); ok && lv != nil {
				// Key is the transaction index within the block, matching TransactionMetadataSet's internal maps
				transactionMetadataSet[uint(i)] = lv.Cbor()
			}
		}
	}
	// Create TransactionMetadataSet by marshaling and unmarshaling
	var metadataSet common.TransactionMetadataSet
	metadataCbor, err := cbor.Encode(transactionMetadataSet)
	if err != nil {
		t.Fatalf("failed to encode metadata map for era %s: %v", eraName, err)
	}
	if err := metadataSet.UnmarshalCBOR(metadataCbor); err != nil {
		t.Fatalf(
			"failed to unmarshal metadata set for era %s: %v",
			eraName,
			err,
		)
	}
	return metadataSet
}

func TestVerifyBlockBody(t *testing.T) {
	// Skip body hash and transaction validation for tests that use blocks without stored CBOR and don't provide ledger state
	config := testSkipAllValidationConfig()

	testCases := []struct {
		name          string
		blockHexCbor  BlockHexCbor
		expectedValid bool
		expectedErr   string
	}{
		{
			// https://cardanoscan.io/block/10882991
			name: "TestVerifyBlockBody success, 34 items",
			blockHexCbor: BlockHexCbor{
				Flag:          0,
				HeaderCbor:    "",
				Eta0:          "4ef95a10f639d0cf16bb963c3a580d4bf2a95b6ae7848702665884843e3c661d",
				Spk:           129600,
				BlockBodyCbor: "",
			},
			expectedValid: true,
		},
		{
			// https://cardanoscan.io/block/10873394
			name: "Large set of aux data, complicated aux",
			blockHexCbor: BlockHexCbor{
				Flag:          0,
				HeaderCbor:    "",
				Eta0:          "4ef95a10f639d0cf16bb963c3a580d4bf2a95b6ae7848702665884843e3c661d",
				Spk:           129600,
				BlockBodyCbor: "",
			},
			expectedValid: true,
		},
		{
			name: "TestVerifyBlockBody should fail",
			blockHexCbor: BlockHexCbor{
				Flag:          0,
				HeaderCbor:    "",
				Eta0:          "95d9b8cbdcde43708d2cf6d1b82e3e7455a6c7a1cc68096905d4d06a48a99159",
				Spk:           129600,
				BlockBodyCbor: "",
			},
			expectedValid: false,
			expectedErr:   "unknown proto major 8 for 10-field header",
		},
	}

	for _, tc := range testCases {
		t.Run(tc.name, func(t *testing.T) {
			// Parse header to determine block type
			headerBytes, err := hex.DecodeString(tc.blockHexCbor.HeaderCbor)
			if err != nil {
				t.Fatalf("failed to decode header hex: %v", err)
			}
			blockType, err := DetermineBlockType(headerBytes)
			if err != nil {
				if tc.expectedErr != "" &&
					strings.Contains(err.Error(), tc.expectedErr) {
					// Expected error, test passes
					return
				}
				t.Fatalf("failed to determine block type: %v", err)
			}
			if tc.expectedErr != "" {
				t.Errorf("expected error %q but got none", tc.expectedErr)
			}

			// Decode components
			headerCborBytes := headerBytes
			bodyCborBytes, err := hex.DecodeString(
				tc.blockHexCbor.BlockBodyCbor,
			)
			if err != nil {
				t.Fatalf("failed to decode body hex: %v", err)
			}

			// Parse header
			header, err := NewBlockHeaderFromCbor(blockType, headerCborBytes)
			if err != nil {
				t.Fatalf("failed to parse header: %v", err)
			}

			// Parse txs based on block type
			var block Block
			var txs []any
			if _, err := cbor.Decode(bodyCborBytes, &txs); err != nil {
				t.Fatalf("failed to decode body CBOR: %v", err)
			}
			eraName, ok := eraNameMap[blockType]
			if !ok {
				t.Fatalf(
					"unsupported block type %d for metadata decoding",
					blockType,
				)
			}
			metadataSet := decodeTransactionMetadataSet(t, txs, eraName)
			switch blockType {
			case BlockTypeShelley:
				transactionBodies := decodeTxBodies[shelley.ShelleyTransactionBody](
					t,
					txs,
					"Shelley",
				)
				shelleyHeader := header.(*shelley.ShelleyBlockHeader)
				block = &shelley.ShelleyBlock{
					BlockHeader:       shelleyHeader,
					TransactionBodies: transactionBodies,
					TransactionWitnessSets: make(
						[]shelley.ShelleyTransactionWitnessSet,
						len(txs),
					),
					TransactionMetadataSet: metadataSet,
				}
			case BlockTypeAllegra:
				transactionBodies := decodeTxBodies[allegra.AllegraTransactionBody](
					t,
					txs,
					"Allegra",
				)
				allegraHeader := header.(*allegra.AllegraBlockHeader)
				block = &allegra.AllegraBlock{
					BlockHeader:       allegraHeader,
					TransactionBodies: transactionBodies,
					TransactionWitnessSets: make(
						[]shelley.ShelleyTransactionWitnessSet,
						len(txs),
					),
					TransactionMetadataSet: metadataSet,
				}
			case BlockTypeMary:
				transactionBodies := decodeTxBodies[mary.MaryTransactionBody](
					t,
					txs,
					"Mary",
				)
				maryHeader := header.(*mary.MaryBlockHeader)
				block = &mary.MaryBlock{
					BlockHeader:       maryHeader,
					TransactionBodies: transactionBodies,
					TransactionWitnessSets: make(
						[]shelley.ShelleyTransactionWitnessSet,
						len(txs),
					),
					TransactionMetadataSet: metadataSet,
				}
			case BlockTypeAlonzo:
				transactionBodies := decodeTxBodies[alonzo.AlonzoTransactionBody](
					t,
					txs,
					"Alonzo",
				)
				alonzoHeader := header.(*alonzo.AlonzoBlockHeader)
				block = &alonzo.AlonzoBlock{
					BlockHeader:       alonzoHeader,
					TransactionBodies: transactionBodies,
					TransactionWitnessSets: make(
						[]alonzo.AlonzoTransactionWitnessSet,
						len(txs),
					),
					TransactionMetadataSet: metadataSet,
					InvalidTransactions:    []uint{},
				}
			case BlockTypeBabbage:
				transactionBodies := decodeTxBodies[babbage.BabbageTransactionBody](
					t,
					txs,
					"Babbage",
				)
				babbageHeader := header.(*babbage.BabbageBlockHeader)
				block = &babbage.BabbageBlock{
					BlockHeader:       babbageHeader,
					TransactionBodies: transactionBodies,
					TransactionWitnessSets: make(
						[]babbage.BabbageTransactionWitnessSet,
						len(txs),
					),
					TransactionMetadataSet: metadataSet,
					InvalidTransactions:    []uint{},
				}
			case BlockTypeConway:
				transactionBodies := decodeTxBodies[conway.ConwayTransactionBody](
					t,
					txs,
					"Conway",
				)
				conwayHeader := header.(*conway.ConwayBlockHeader)
				block = &conway.ConwayBlock{
					BlockHeader:       conwayHeader,
					TransactionBodies: transactionBodies,
					TransactionWitnessSets: make(
						[]conway.ConwayTransactionWitnessSet,
						len(txs),
					),
					TransactionMetadataSet: metadataSet,
					InvalidTransactions:    []uint{},
				}
			default:
				t.Fatalf("unsupported block type %d", blockType)
			}

			// No need to re-parse

			isValid, _, _, _, err := VerifyBlock(
				block,
				tc.blockHexCbor.Eta0,
				uint64(tc.blockHexCbor.Spk),
				config,
			)
			if tc.expectedValid != isValid {
				t.Errorf(
					"unexpected validity: got %v, expected %v",
					isValid,
					tc.expectedValid,
				)
			}
			if tc.expectedErr != "" &&
				(err == nil || !strings.Contains(err.Error(), tc.expectedErr)) {
				t.Errorf("unexpected error: %v", err)
			}
			if tc.expectedErr == "" && err != nil {
				t.Fatalf("unexpected error: %v", err)
			}
		})
	}
}

func TestVerifyBlock_SkipBodyHashValidation(t *testing.T) {
	// Skip body hash and transaction validation
	config := testSkipAllValidationConfig()

	// This test is lightweight: it constructs a minimal Shelley header/body
	// and a block with empty CBOR to simulate missing CBOR scenario.
	// VerifyBlock should not error due to missing CBOR when skipping.

	// Minimal values for inputs
	eta0Hex := strings.Repeat("00", 32)
	slotsPerKesPeriod := uint64(129600)

	// Build a tiny Shelley block with zeroed fields
	header := &shelley.ShelleyBlockHeader{}
	block := &shelley.ShelleyBlock{BlockHeader: header}
	// Call VerifyBlock and ensure it doesn't fail because of body hash/CBOR
	_, _, _, _, err := VerifyBlock(block, eta0Hex, slotsPerKesPeriod, config)
	if err != nil {
		if strings.Contains(
			err.Error(),
			"block CBOR is required for body hash verification",
		) {
			t.Fatalf(
				"SkipBodyHashValidation should bypass body CBOR requirement, got: %v",
				err,
			)
		}
		// Other errors (e.g., VRF/KES) are acceptable for this test's purpose
	}
}

func TestVerifyBlock_TransactionValidation(t *testing.T) {
	// This test enables transaction validation and verifies it integrates correctly with VerifyBlock
	config := common.VerifyConfig{
		SkipBodyHashValidation:    true,  // Skip to focus on transaction validation
		SkipTransactionValidation: false, // Enable transaction validation
		SkipStakePoolValidation:   true,  // Skip stake pool validation
		LedgerState:               &mockLedgerStateVerifyBlock{},
		ProtocolParameters:        &mockProtocolParamsVerifyBlock{},
	}

	testCases := []struct {
		name          string
		blockHexCbor  BlockHexCbor
		expectedValid bool
		expectedErr   string
	}{
		{
			// Use the same successful block from TestVerifyBlockBody
			name: "TestVerifyBlock_TransactionValidation success",
			blockHexCbor: BlockHexCbor{
				Flag:       0,
				HeaderCbor: "",
				Eta0:       "4ef95a10f639d0cf16bb963c3a580d4bf2a95b6ae7848702665884843e3c661d",
				Spk:        129600,
			},
			expectedValid: true,
			expectedErr:   "",
		},
	}

	for _, tc := range testCases {
		t.Run(tc.name, func(t *testing.T) {
			// Parse the block using the same logic as TestVerifyBlockBody
			headerCborBytes, err := hex.DecodeString(tc.blockHexCbor.HeaderCbor)
			if err != nil {
				t.Fatalf("failed to decode header CBOR: %v", err)
			}

			blockType, err := DetermineBlockType(headerCborBytes)
			if err != nil {
				t.Fatalf("failed to determine block type: %v", err)
			}

			// Create a minimal block to test the integration
			// This test verifies that transaction validation is properly enabled and
			// that VerifyBlock succeeds when there are no transactions to validate
			header, err := NewBlockHeaderFromCbor(blockType, headerCborBytes)
			if err != nil {
				t.Fatalf("failed to parse header: %v", err)
			}

			// Create a minimal Conway block for testing
			conwayHeader, ok := header.(*conway.ConwayBlockHeader)
			if !ok {
				t.Fatalf("expected Conway header, got %T", header)
			}
			block := &conway.ConwayBlock{
				BlockHeader:            conwayHeader,
				TransactionBodies:      []conway.ConwayTransactionBody{}, // Empty for this test
				TransactionWitnessSets: []conway.ConwayTransactionWitnessSet{},
				TransactionMetadataSet: common.TransactionMetadataSet{},
				InvalidTransactions:    []uint{},
			}

			isValid, _, _, _, err := VerifyBlock(
				block,
				tc.blockHexCbor.Eta0,
				uint64(tc.blockHexCbor.Spk),
				config,
			)
			// Since we have empty transactions, validation should pass (no transactions to validate)
			if !isValid || err != nil {
				t.Errorf(
					"expected validation to pass with empty transactions, got valid=%v, err=%v",
					isValid,
					err,
				)
			}
		})
	}
}

